import React, { useEffect } from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";
import {API_URL} from '../api/config'

interface NavigationI {
    title:string,
    path:string  ,
    com:any
}

interface NavigationProps{
    data:NavigationI[];
}


const Navigation: React.FC<NavigationProps> = ({ data }: NavigationProps) => {
    useEffect(() => {
        GetProfileDetails(API_URL);
      }, [])
    return (
        <Router>
            <div>
                <ul>
                    {data.map((item) => {
                        return (
                            <li>
                                <Link to={item.path}>{item.title}</Link>
                            </li>
                        )
                    })}
                </ul>
                <Routes>
                {data.map((item) => {
                    return(
                    <Route path={item.path} element={<item.com/>} />
                    )
                })}
                </Routes>
            </div>
        </Router>
    )
}

export default Navigation;
